import React from 'react';


const App = () => {
  return (
    <>
      <div className='app'>
        <main>
          <div className="search_box">
            <input type="text"
              className="search_bar"
              placeholder="Search..."
            />
          </div>
          <div className="location_box">
            <div className="location">Kolkata,India</div>
            <div className="date">{() => {
              let d = new Date();
              return d.toDateString();
            }}</div>
          </div>
        </main>
      </div>
    </>
  )
}
export default App;
